function removeChar(cur, c) {
    const re = new RegExp(`${c}`, 'ig');
    return cur.replace(re,"");
}

function destroy(stack) {
    if (stack.length > 1
        && stack[stack.length - 2] !== stack[stack.length - 1]
        && stack[stack.length - 2].toLowerCase() === stack[stack.length - 1].toLowerCase())
        return 2;
    return 0;
}

function betterReact(str) {
    let stack = new Array();
    for (let c of str) {
        stack.push(c);
        let remove = destroy(stack);
        while (remove > 0) {
            for (let i = 0; i < remove; ++i)
                stack.pop();
            remove = destroy(stack);
        }
    }
    return stack.join('');
}

let reactions = new Array();
for (let c of "abcdefghijklmnopqrstuvwxyz") {
    reactions.push([c, betterReact(removeChar(input,c)).length]);
}
reactions.sort((a,b) => a[1] - b[1]);

const part2 = `Part 2: ${reactions[0][1]}`;
